import "./Dashbord.css";
import download from "../images/download.png";
import slogo from "../images/shlogo.jpg";
import axios from "axios";
import { useEffect, useState } from "react";

function Dashbord() {
  const [data, setdata] = useState([]);

  useEffect(() => {
    axios
      .get("/api/student")
      .then((res) => {
        setdata(res.data);
        // console.log('data recived',res.data);
      })
      .catch((err) => {
        console.log("err", err);
      });
  });

  // fetch("http://localhost:5000/complain")
  //   .then((response) => {
  //     return response.json();
  //   })
  //   .then((data) => {
  //     console.log(data);
  //     // setcom(data);
  //     // const d=data;
  //   });

  return (
    <div>
      <div className="flex p-9  bg-gray-700 ">
        <img src={slogo} alt="img" className="h-20  w-20  rounded-3xl" />
        <div className="px-5 py-5  text-5xl ">
          <h1>
            Society<span>HUB</span>
          </h1>
        </div>
      </div>
      <div className="main">
        <div className="bg-gray-600  flex-col">
          <div id="img_nav">
            <img src={download} alt="img" className="imgs" />
            <p className="text-5xl px-6 py-4 mx-8 ">Ketan</p>
          </div>
        </div>
        <div className="main_dash">
          <div></div>
          <p>mahadev</p>
          {
          data.map((d) => (
            <>
            <h2>{d.rollno}</h2>
            <h3>{d.fullname} </h3>
            </>
          ))
          }
        </div>
      </div>
    </div>
  );
}

export default Dashbord;
